import React, { useState, useMemo } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { ThemeProvider, createTheme, CssBaseline, Box } from '@mui/material';
import Header from './components/Header';
import Hero from './components/Hero';
import About from './components/About';
import Experience from './components/Experience';
import Projects from './components/Projects';
import Skills from './components/Skills';
import Testimonials from './components/Testimonials';

const App: React.FC = () => {
  const [themeMode, setThemeMode] = useState<'light' | 'dark'>('light');

  const theme = useMemo(
    () =>
      createTheme({
        palette: {
          mode: themeMode,
          primary: {
            main: '#2196F3',
            light: '#64B5F6',
            dark: '#1976D2',
          },
          secondary: {
            main: '#4CAF50',
            light: '#81C784',
            dark: '#388E3C',
          },
          background: {
            default: themeMode === 'light' ? '#F5F5F5' : '#121212',
            paper: themeMode === 'light' ? '#FFFFFF' : '#1E1E1E',
          },
          text: {
            primary: themeMode === 'light' ? '#212121' : '#FFFFFF',
            secondary: themeMode === 'light' ? '#757575' : '#B0B0B0',
          },
          error: {
            main: '#F44336',
          },
          warning: {
            main: '#FFA726',
          },
          info: {
            main: '#29B6F6',
          },
          success: {
            main: '#66BB6A',
          },
        },
      }),
    [themeMode]
  );

  const themeWithComponents = useMemo(
    () =>
      createTheme(theme, {
        typography: {
          fontFamily: '"Roboto", "Helvetica", "Arial", sans-serif',
          h1: {
            fontSize: '2.5rem',
            fontWeight: 700,
          },
          h2: {
            fontSize: '2rem',
            fontWeight: 600,
          },
          h3: {
            fontSize: '1.75rem',
            fontWeight: 600,
          },
          h4: {
            fontSize: '1.5rem',
            fontWeight: 600,
          },
          h5: {
            fontSize: '1.25rem',
            fontWeight: 500,
          },
          h6: {
            fontSize: '1rem',
            fontWeight: 500,
          },
          body1: {
            fontSize: '1rem',
            lineHeight: 1.5,
          },
          body2: {
            fontSize: '0.875rem',
            lineHeight: 1.43,
          },
        },
        components: {
          MuiButton: {
            styleOverrides: {
              root: {
                borderRadius: '8px',
                textTransform: 'none',
                fontWeight: 500,
                padding: '8px 16px',
              },
              contained: {
                boxShadow: 'none',
                '&:hover': {
                  boxShadow: '0px 2px 4px rgba(0,0,0,0.1)',
                },
              },
            },
          },
          MuiPaper: {
            styleOverrides: {
              root: {
                backgroundImage: 'none',
              },
            },
          },
        },
      }),
    [theme]
  );

  const handleToggleTheme = () => {
    setThemeMode((prevMode) => (prevMode === 'light' ? 'dark' : 'light'));
  };

  return (
    <ThemeProvider theme={themeWithComponents}>
      <CssBaseline />
      <Router>
        <Box
          sx={{
            minHeight: '100vh',
            background: themeMode === 'light'
              ? `linear-gradient(135deg, rgba(255,255,255,0.1) 0%, rgba(255,255,255,0.05) 100%)`
              : `linear-gradient(135deg, rgba(0,0,0,0.7) 0%, rgba(0,0,0,0.5) 100%)`,
            backgroundSize: 'cover',
            backgroundPosition: 'center',
            backgroundAttachment: 'fixed',
            position: 'relative',
          }}
        >
          <Box sx={{ position: 'relative', zIndex: 1 }}>
            <Header onToggleTheme={handleToggleTheme} themeMode={themeMode} />
            <Box sx={{ p: { xs: 2, sm: 3, md: 4 } }}>
              <Routes>
                <Route
                  path="/"
                  element={
                    <>
                      <Hero themeMode={themeMode} />
                      <About themeMode={themeMode} />
                      <Experience themeMode={themeMode} />
                      <Projects themeMode={themeMode} />
                      <Skills themeMode={themeMode} />
                      <Testimonials themeMode={themeMode} />
                    </>
                  }
                />
                <Route path="/about" element={<About themeMode={themeMode} />} />
                <Route path="/experience" element={<Experience themeMode={themeMode} />} />
                <Route path="/projects" element={<Projects themeMode={themeMode} />} />
                <Route path="/skills" element={<Skills themeMode={themeMode} />} />
                <Route path="/testimonials" element={<Testimonials themeMode={themeMode} />} />
              </Routes>
            </Box>
          </Box>
        </Box>
      </Router>
    </ThemeProvider>
  );
};

export default App;
